-module(myserver).
-behavior(gen_server).
-export([code_change/3,
    handle_call/3,
    handle_cast/2,
    handle_info/2,
    init/1,
    terminate/2]).

code_change(_OldVsn, _State, _Extra) ->
    {error, "NYI"}.

handle_call(Name, _From, State) ->
    Reply = lists:flatten(io_lib:format("hello ~s from myserver", [Name])),
    {reply, Reply, State}.

handle_cast(_Request, State) ->
    {noreply, State}.


%% this clause will be called every 15 seconds
handle_info(request, StateData = [Host])->

    Body = "",

    request(Host, Body),
    self() ! request,
    {noreply, StateData};


handle_info(_Info, State) ->
    {noreply, State}.

init([Host]) ->
        process_flag(trap_exit, true),
        io:format("myserver init~n"),
        self() ! request,
    {ok, [Host]}.

terminate(_Reason, _State) ->
    io:format("myserver terminate~n"),
    [].



request(Host, Body) ->
    Id = base64:encode(crypto:strong_rand_bytes(50)),
    Result = httpc:request(post, {Host, [{"X-Request-Id", Id}], "application/x-www-form-urlencoded", Body}, [{ssl, [{verify, verify_none}]}], []),
    case Result of

        {ok, {{_, _Status, _}, _, _Response}} ->
            % io:format("request ok ~p~n", [_Status]),
            ok;
        Error   ->
            io:format("request error: ~p ~p~n", [Id, Error]),
            {error, Error}
    end.


